// SPDX-License-Identifier: MIT
pragma solidity 0.8.1;

import "@openzeppelin/contracts/utils/Counters.sol";

contract GeekNft {
    using Counters for Counters.Counter;

    string private name = "GeekNft";
    string private symbol = "GEEKT";

    Counters.Counter private tokenIds;
    address marketplaceAddress;

    mapping(address => uint) itemsOwnerCount;
    mapping(uint => address) itemToOwner;

    mapping(address => uint) itemsCreatorCount;
    mapping(uint => address) itemToCreator;

    event nftMinted(uint);
    event Transfer(address indexed from, address indexed to, uint tokenId);

    constructor(address _marketplaceAddress){
        marketplaceAddress = _marketplaceAddress;
    }

    function mint(string memory _tokenUri) public {
        tokenIds.increment();
        uint newTokenId = tokenIds.current();
        _safeMint(msg.sender, newTokenId);
    } 

    function _safeMint(address _to, uint _tokenId) private{
        require(itemToCreator[_tokenId] == address(0), "token already exist");
        require(_to == address(0), "mint to the zero address");

        itemToOwner[_tokenId] = _to;
        itemToCreator[_tokenId] = _to;

        unchecked{
            itemsOwnerCount[_to]++;
            itemsCreatorCount[_to]++;
        }

        emit Transfer(address(0), _to, _tokenId);
    }

}

